IF @CurrentMigration < '202104031535001_removedExtraColumnGenreId'
BEGIN
    DECLARE @var0 nvarchar(128)
    SELECT @var0 = name
    FROM sys.default_constraints
    WHERE parent_object_id = object_id(N'dbo.Videos')
    AND col_name(parent_object_id, parent_column_id) = 'GenreId';
    IF @var0 IS NOT NULL
        EXECUTE('ALTER TABLE [dbo].[Videos] DROP CONSTRAINT [' + @var0 + ']')
    ALTER TABLE [dbo].[Videos] DROP COLUMN [GenreId]
    INSERT [dbo].[__MigrationHistory]([MigrationId], [ContextKey], [Model], [ProductVersion])
    VALUES (N'202104031535001_removedExtraColumnGenreId', N'CodeFirstApproach.Migrations.Configuration',   , N'6.1.3-40302')
